import React from 'react';
import Tour from './Tour';

const ToursList =({tours, setTours})=> {
    return (
        <div className="tour-list">
            {tours.map((tour) => {
                <Tour image={tour.image} tittle={tour.name} id={tour.id} description={tour.info} />
            })}
        </div>
    )
}

export default ToursList
